import React, { useState, useEffect } from 'react'
import Details from './Details';
import style from './recipe.module.css';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';
import { Component } from 'react';
import { render } from '@testing-library/react';


const Recipes = (props) => {
    console.log(props);
    function getData(props){
        <Details meal={props.cuisine} />
    
    }



    {
        return (

        <div className="col-4">
            <div className="card mb-3 mt-3">
                <div className="row">
                    <div className="col-5">
                        <img className={style.image} src={props.image} alt="" />
                    </div>
                    <div className="col-7">
                        <div className="row">
                            <div className="col-12">
                                <div className={style.title}>{props.title}</div>
                            </div>
                        </div>



                        <div className="row"><div className="col-12"><div className={style.meal}><p>{props.meal}</p></div></div></div>
                        <div className="row"><div className="col-12"><div className={style.diet}><p>{props.diet}</p></div></div></div>
                        <div className="row"><div className="col-12"><div className={style.cuisine}><p>{props.cuisine} cuisine</p></div></div></div>
                        <div className="row"><div className="col-12"><div className="button" onClick={getData(props)}><Link className="nav-link" to="/details">Taste It</Link></div></div></div>

                        








                    </div>
                </div>
            </div>
        </div>

    );
}
}

export default Recipes;
